  \"Horicon National Wildlife Refuge, Fox River National Wildlife Refuge, Wisconsin
  Islands Wilderness, Green Bay and Gravel Islands National Wildlife Refuges: Annual
  narrative report: Calendar year 1988\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:21.674962\",\n\t\"name\": \"horicon-national-wildlife-refuge-fox-river-national-wildlife-refuge-wisconsin-islands-wild-60e19\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Horicon
  NWR, Fox River NWR, Wisconsin Islands Wilderness, Green Bay NWR, and Gravel Islands
  NWR outlines Refuge accomplishments during the 1988 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses the master plan, management planning, and research
  and investigations. Refuge administration is outlined; information about personnel,
  youth programs, volunteer programs, funding, and safety is given. Habitat management
  is also covered; subjects include wetlands, forests, croplands, grasslands, grazing,
  fire management, and pest control. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, game mammals, fisheries resources, scientific collections,
  animal control, marking and bird banding, and disease control. The public uses of
  the Refuge described in this report include outdoor classrooms, interpretive programs,
  hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, and communication
  systems. Cooperative programs and items of interest are provided at the end. Refuge
  brochures and newspaper articles are attached.\",\n\t\"license_title\": \"License
